import React from 'react'
import Star from '../resources/starGray'
import './ReviewsPeoples.css';


const ReviewsPeoples = () => {
    const OneReview = [
        {
            oneName:'123',
            oneDate:'let now = new Date()',
            oneReviews: '345',
        }
    ]
    const { oneName, oneDate, oneReviews } = OneReview


    return (
        <div className='all_reviews'>
        <div className='header_all_reviews'>
            <div className='name_all_reviews'>{OneReview.oneName}</div> 
            <div className='data_all_reviews'>19 декабря 2022</div> 
            <div className='zvezdi_all_reviews'>
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg>

            </div>
        </div>
        <div className='otziv_all_reviews'>Фильм говнушка, где он встречает Женщину-Кошку, Пингвина, Кармайна Фальконе и Загадочника. Теперь под прицелом оказывается сам Бэтмен, которому предстоит отличить друга от врага и восстановить справедливость во имя Готэма.</div>
    </div>
    )
}


export default ReviewsPeoples;
